description:
The Stranglers are an English rock band who emerged via the punk rock scene.

Scoring some 23 UK top 40 singles and 17 UK top 40 albums to date in a career spanning four decades, the Stranglers are one of the longest-surviving and most &quot;continuously successful&quot; band to have originated in the UK punk scene of the mid to late 1970s. Beginning life as the Guildford Stranglers on 11 September 1974 in Guildford, Surrey,[note 1] they originally built a following within the mid-1970s pub rock scene. While their aggressive, no-compromise attitude identified them as one of the instigators of the UK punk rock scene that followed, their idiosyncratic approach rarely followed any single musical genre and the group went on to explore a variety of musical styles, from new wave, art rock and gothic rock through the sophisticated pop of some of their 1980s output.
